import DashboardLayout from "../components/dashboardLayout";
import { Button } from "antd";

const Settings = () => {
    return (
        <div className="wrapper">
            <h2>Settings</h2>
            <div id="logout">
                <p>Logout</p>
                <div id="button">
                    <Button>Logout</Button>
                </div>

            </div>

            <style jsx>{`
                .wrapper {
                    display: flex;
                    flex-direction: column;
                    margin-top: 50px;
                    width: 100%;
                }

                #logout {
                    display: flex;
                    width: 100%;
                }

                #logout #button {
                    margin-left: 50%;
                }
            `}</style>
        </div>
    )
}

Settings.Layout = DashboardLayout

export default Settings
